import React from 'react';
import { Data } from './Components/Data'; // Ensure Data is an array

function App() {
    return (
        <div className='bg-gray-400'>
            <h1 className='text-center text-black text-[50px]'>CARTS</h1>
            {/* Use map only if Data is an array */}
            {Array.isArray(Data) && Data.map((item, index) => (
                <div key={index} className='w-[250px] h-auto flex justify-around flex-wrap'>
                    <span>{item.price}</span>
                    <span>{item.name}</span>
                </div>
            ))}
        </div>
    );
}

export default App;
